import { createSlice } from '@reduxjs/toolkit'

const initialState = ''

const filterSlice = createSlice({
  name: 'filter',
  initialState,
  reducers: {
      showWithFilter(state, action) {

          const searched = action.payload.searched
          const anecdotes = action.payload.anecdotes

          console.log(`tässä etsitty ${searched}`)
          console.log(`tässä lista ${anecdotes}`)


          return "moimoi"
      },

      otherFilter(state) {
          return ''
      }
  }
})

export const { showWithFilter, otherFilter } = filterSlice.actions
export default filterSlice.reducer
